import TermsList from "./TermsList";

interface Props{
    query: string;
}

export default function MatchesContainer({query}:Props){
    return (
        <>
            {query && (<ul data-matches-container className="border-slate-600 border-2" >
            <TermsList query={query} />
            </ul>)}
        </>)

}
